import { useEffect } from "react";

const Home = () => {
  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("http://localhost:5000/api/sugars");
      const data = await response.json();
    };
    fetchData();
  });

  return (
    <div>
      <h2>SugarSync</h2>
    </div>
  );
};

export default Home;
